import React from 'react'
import Projs from './ProjectsApi'

function Proj() {
  return (
   <>
   {
    Projs.map((currEle,index)=>{
        return (
            <div className="card">
                <img src="" alt="An Image" />
                <h1>{currEle.Description}</h1>
            </div>
        )
    })
   }
   
   </>
  )
}

export default Proj
